import { StyledSocial } from "./styles/Social.styled";
import githubIcon from "../assets/githubIcon.svg";
import githubWhite from "../assets/githubWhite.svg";
import twitter2 from "../assets/twitterIcon.svg";
import linkedIcon from "../assets/linkedIcon.svg";

const Social = () => {
  return (
    <StyledSocial>
      {/* <img src={githubIcon} alt="github icon" /> */}
      <img src={githubWhite} alt="github icon" />

      <img src={linkedIcon} alt="linked in icon" />

      <img src={twitter2} alt="satchel icon" />
    </StyledSocial>
  );
};

export default Social;
